import React from "react";
import "./style.css";
import UserCard from "../components/UserCard";

function SearchResults(props) {
  return (
    <ul className="list-group search-results">
      {props.results.map(result => (
        <li key={result.login.uuid} className="list-group-item">
          <img alt="User" src={result.picture.thumbnail} className="img-fluid" />
          <p><strong>Name:</strong> {result.name.first} {result.name.last}</p>
          <p><strong>State:</strong> {result.location.state}</p>
          <p><strong>Gender:</strong> {result.gender}</p>
        </li>
      ))}
    </ul>
  );
}

export default SearchResults;
